import React from "react";

import "./section3.css";

const Section3 = () => {
  return (
    <div className="container s3_container">
      <div className="s3_wrapper">
        <div className="row">
          <div className="col-12 s3">
            <h1 className="s3_h1">HELLO</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Section3;
